import React from 'react';
import styled from 'styled-components';

const Warpper = styled.div``;

const Date = styled.h1`
  color: var(--color-main);
  width: 221px;
  height: 79px;
  border: 1px solid;
`;

const Circle = styled.div`
  width: 221px;
  height: 79px;
  border: 1px solid;
`;

export default function Intro() {
  return (
    <div>
      <Warpper>
        <Date>2024 04 28</Date>
        <Circle />
      </Warpper>
    </div>
  );
}
